import React, { useEffect } from "react";
import { useLocation } from "react-router-dom";

const UpdateUser = () => {
  const location = useLocation();

  useEffect(() => {
    console.log(location);
  }, []);

  return (
    <div className="bg-zinc-400 h-screen flex justify-center items-center">
      <div className="bg-white rounded-lg shadow-black/30 h-96 pl-10 space-y-3 w-[400px] flex flex-col justify-center">
        <div className="flex flex-col md:flex-row items-center justify-between bg-white-400 border-solid border-2 border-black rounded-lg mr-10 mb-20 p-4">
          <div className="flex items-center mb-3 md:mb-0">
            <span className="mr-3">First Name:</span>
            <input
              placeholder="First Name"
              className="outline-none h-10 px-5 border border-sm"
            />
          </div>
          <div className="flex items-center mb-3 md:mb-0">
            <span className="mr-3">Last Name:</span>
            <input
              placeholder="Last Name"
              className="outline-none h-10 px-5 border border-sm"
            />
          </div>
          <div className="flex items-center mb-3 md:mb-0">
            <span className="mr-3">Email:</span>
            <input
              placeholder="Email"
              className="outline-none h-10 px-5 border border-sm"
              disabled
            />
          </div>
          <button className="ml-3 bg-blue-600 rounded-lg pb-2 pt-1 mr-2 pr-1 pl-1">
            Update Details
          </button>
        </div>
      </div>
    </div>
  );
};

export default UpdateUser;
